import styled from "styled-components";

export const Wrapper = styled.div `
	{	
        height: 100vh;
        width: 100vw;
		background-color: #F7F9F9;

	}
`;


export const WelcomeMessage = styled.div `

	text-align: left;


	height: 5em;
	h2 {
		font-size 2.4em;
		text-align: center;

	}
`;

export const Content = styled.div `
    display: flex;
    flex-direction: column;
    width: 100%;
    height: 85%;

`;


export const LoadAtHomePic = styled.div `
	display: flex;
	flex:2;
	height: 65%;
	width: 100%;
	background-color:#2DBEFF;
	div {
		width:50%
	}

`;


export const NewBikePic = styled.div `
	display: flex;
	flex:2;
	max-height: 30%;
	width: 100%;
	background-color:#2DBEFF;
	border-top: 1em solid white;
	justify-content: space-between;

	div {
		width: 33%;
		align-items: center;

	}

`;
